struct defaultobj *objFindByPadNum(s32 padnum)
{
	struct prop *prop = g_Vars.list1head;

	while (prop) {
		if (prop->type == PROPTYPE_OBJ) {
			struct defaultobj *obj = prop->obj;

			if (obj->pad == (s16)padnum) {
				return obj;
			}
		}

		prop = prop->next;
	}

	return NULL;
}

