struct weaponobj *weaponFindThrown(s32 weaponnum)
{
	struct prop *prop = g_Vars.list1head;

	while (prop) {
		struct weaponobj *weapon = func0f08aa70(weaponnum, prop);

		if (weapon && (weapon->base.hidden & OBJHFLAG_AIRBORNE) == 0) {
			return weapon;
		}

		prop = prop->next;
	}

	return NULL;
}

