void chrSetObjHiddenFlag4OnWeapon(struct chrdata *chr, s32 hand)
{
	if (chr && chr->weapons_held[hand]) {
		struct defaultobj *obj = chr->weapons_held[hand]->obj;
		obj->hidden |= OBJHFLAG_00000004;
	}
}

