void doorActivatePortal(struct doorobj *door)
{
	if (door->portalnum >= 0) {
		portalSetEnabled(door->portalnum, true);
	}
}

void doorDeactivatePortal(struct doorobj *door)
{
	if (door->portalnum >= 0) {
		portalSetEnabled(door->portalnum, false);
	}
}

