{
	door->base.flags &= ~OBJFLAG_DOOR_KEEPOPEN;

	func0f08daa8(door->soundtype, door->base.prop);

	door->fadetime60 = door->doortype == DOORTYPE_LASER ? 60 : 0;

	if (door->doortype == DOORTYPE_LASER) {
		door->laserfade = 0;
	}
}

