bool posIsInDrawDistance(struct coord *pos)
{
	struct coord *campos = &g_Vars.currentplayer->cam_pos;
	f32 x = pos->x - campos->x;
	f32 y = pos->y - campos->y;
	f32 z = pos->z - campos->z;
	f32 aggregate = x * x + y * y + z * z;
	bool result = true;

	if (aggregate > 1024000000) {
		result = false;
	}

	return result;
}

